function add(num1, num2) {
  return num1+num2 //มี ; หรือไม่มี ; ก็ได้
}
function minus(num1, num2) {
  return num1-num2
}
function div(num1, num2) {
  return num1/num2
}
function multiply(num1, num2) {
  return num1*num2
}
